import React from 'react';
import logo from './assets/logos/wizardry.png';
import styled from 'styled-components';

const MaintenanceLayout = styled.div`
    width: 80%;
    height: 100%;
    border: solid 1px black;
    display: flex;
    justify-content: center;
    align-items: center;
`
const MaintenanceMessage = styled.div`
    width: 40%;
    height: 100%;
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
`
const MessageTitle = styled.div`
    font-size: 5vw;
`;

const MessageSubtitle = styled.div`
    font-size: 2vw;
`;


const MaintenanceImage = styled.img`
    width: 60%;
    object-fit: contain;
`


const Maintenance = () => {
    return (
        <MaintenanceLayout >
            <MaintenanceMessage>
                <MessageTitle>Site is being built!</MessageTitle>
                <MessageSubtitle>Site is being built!</MessageSubtitle>
            </MaintenanceMessage>
            <MaintenanceImage />
        </MaintenanceLayout>

    );
}

export default Maintenance;
